import React, { Component } from 'react';
import { InfoConsumer } from '../context';

class Details extends Component {
    render() {
        return (
            <InfoConsumer>
                {data => {
                    const {
                        id,
                        headerTitle,
                        headerSubTitle,
                        headerText,
                        img,
                        title,
                        maps,
                        description
                    } = data.detailInfo
                }

                }
            </InfoConsumer>
        )
    }
}

export default Details;
